from itertools import groupby
from sympy.combinatorics.partitions import IntegerPartition
from sympy.utilities.iterables import partitions, multiset_permutations
def compositions(n): yield from (c for p in partitions(n) for c in multiset_permutations(IntegerPartition(p).partition))
def a(n): return sum(1 for c in compositions(n) if all(len(list(g))<=k for k, g in groupby(c)))
print([a(n) for n in range(20)]) # _Michael S. Branicky_, Oct 12 2025

